edge_count_iter:           # Placeholder implementation.  Your code here!
	li $v0, 0              # num edges
	li $t0, 0			   # loop counter, i
	li $t4, -1

	LOOP:
	beq $t0, $a1, END      # if i == num nodes, stop counting
	move $t1, $t0         # index of start of edge list, j
	sll $t1, $t1, 2       # use this to address arr[j]; multiply by 4
	add $t1, $a0, $t1     # add j to base address of arr
	LOOP2:
		lw $t2, 0($t1)        # get value in arr[j]
		beq $t2, $t4, END2    # if arr[j] == -1, stop following list
		addi $v0, 1           # num edges += 1
		sll $t2, $t2, 2
		add $t1, $a0, $t2     # set pointer to to next in array
	b LOOP2
	END2:
	addi $t0, 1
	b LOOP

	END:
	jr $ra

	
